import './App.css';
import { Route, BrowserRouter, Switch, Redirect} from "react-router-dom"; 
import routes from './config/routes';
import { isRegistered } from './utils/cookie';

const RegRoute = ({component:Component, ...rest}) => {
  return (
    <Route {...rest}
      render = {() => {
        if (isRegistered()) {
          return <Component />
        }
        else {
          return <Redirect to="/" />
        }
      }}
    />
  )
}

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        {routes.map((route) => {
          if(route.isRegis) {
            return (
              <Route
                path={route.path} 
                exact component={route.component} 
                key={route.path}
              />
            )
          }
          else {
            return (
              <RegRoute
                path={route.path} 
                exact component={route.component} 
                key={route.path}
              />
            )
          }
        })}
      </Switch>
    </BrowserRouter>
  );
}

export default App;
